import React from "react";
import MyNavbar from "./components/Navbar";
import Hero from "./components/Hero";
import ThreeColumns from "./components/ThreeColumns";
import Footer from "./components/Footer";

function App() {
  return (
    <>
      <MyNavbar />
      <Hero />
      <ThreeColumns />
      <Footer />
    </>
  );
}

export default App;
